  \"Aerial Breeding Pair Surveys of the Arctic Coastal Plain of Alaska : Distribution
  and Abundance 1995\",\n\t\"tracking_summary\": {\n\t\t\"total\": 3,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:20:45.538817\",\n\t\"name\": \"aerial-breeding-pair-surveys-of-the-arctic-coastal-plain-of-alaska-distribution-and-abund-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"An aerial breeding pair survey was conducted
  on the Arctic Coastal Plain of Alaska for the 10th consecutive year in 1995. The
  population estimate for the northern pintail (230,588) was 68% higher than in 1994.
  Estimates for scaup, yellow-billed loon, and pacific loon were up 18.8%, 24% and
  35%, respectively. Greater white-fronted goose estimates were down 13% and oldsquaw
  and tundra swan estimates were comparable to 1994. No estimates were significantly
  different (P > 0.05) from 1994. We investigated trends in populations of 9 species
  with log-linear regression and examined the effectiveness of the survey with power
  analysis. Populations of 8 species were either stable or changing at a rate too
  low to detect. The yellow-billed loon population increased at an annual rate of
  10% (P = 0.012, n = 9) from 1987 through 1995. With the current survey design we
  should be capable of detecting a 10% annual change in 6-11 years of surveys and
  a 5% annual change in 9-17 years depending upon the species. Density contour maps
  are presented for the common species and groups.\",\n\t\"license_title\": \"License
